DROP TABLE IF EXISTS `juego`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `juego` (
  `Id` int NOT NULL AUTO_INCREMENT,
  `NombreJuego` varchar(100) DEFAULT NULL,
  `IdGenero` int DEFAULT NULL,
  `IdDesarrolladora` int DEFAULT NULL,
  `IdPlataforma` int DEFAULT NULL,
  `FechaLanzamiento` varchar(60) DEFAULT NULL,
  `NumeroJugadores` varchar(50) DEFAULT NULL,
  `Metascore` tinyint DEFAULT NULL,
  `PuntajeUsuario` tinyint DEFAULT NULL,
  `IdUsuarioCrea` int DEFAULT NULL,
  `FechaCrea` datetime DEFAULT CURRENT_TIMESTAMP,
  `IdUsuarioModifica` int DEFAULT NULL,
  `FechaModifica` datetime DEFAULT NULL,
  `Estatus` bit(1) DEFAULT b'1',
  PRIMARY KEY (`Id`),
  KEY `FK_JuegoGenero` (`IdGenero`),
  KEY `FK_JuegoPlataforma` (`IdPlataforma`),
  KEY `FK_JuegoDesarrolladora` (`IdDesarrolladora`),
  KEY `FK_JuegoUsuarioCrea` (`IdUsuarioCrea`),
  KEY `FK_JuegoUsuarioModifica` (`IdUsuarioModifica`),
  KEY `IX_Juego` (`Id`),
  CONSTRAINT `FK_JuegoDesarrolladora` FOREIGN KEY (`IdDesarrolladora`) REFERENCES `desarrolladora` (`Id`),
  CONSTRAINT `FK_JuegoGenero` FOREIGN KEY (`IdGenero`) REFERENCES `genero` (`Id`),
  CONSTRAINT `FK_JuegoPlataforma` FOREIGN KEY (`IdPlataforma`) REFERENCES `plataforma` (`Id`),
  CONSTRAINT `FK_JuegoUsuarioCrea` FOREIGN KEY (`IdUsuarioCrea`) REFERENCES `usuario` (`Id`),
  CONSTRAINT `FK_JuegoUsuarioModifica` FOREIGN KEY (`IdUsuarioModifica`) REFERENCES `usuario` (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=5700 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
