  CONSTRAINT `FK_ReviewsJuego` FOREIGN KEY (`IdJuego`) REFERENCES `juego` (`Id`),
  CONSTRAINT `FK_ReviewUsuarioCrea` FOREIGN KEY (`IdUsuarioCrea`) REFERENCES `usuario` (`Id`),
  CONSTRAINT `FK_ReviewUsuarioModifica` FOREIGN KEY (`IdUsuarioModifica`) REFERENCES `usuario` (`Id`)
